Below is an instruction that describes a task. Write a response that appropriately completes the request. ### Instruction: The sequence of integers in the row of squares and in each of the two columns of squares form three distinct arithmetic sequences. What is the value of $N$?

[asy]
unitsize(0.35inch);
draw((0,0)--(7,0)--(7,1)--(0,1)--cycle);
draw((1,0)--(1,1));
draw((2,0)--(2,1));
draw((3,0)--(3,1));
draw((4,0)--(4,1));
draw((5,0)--(5,1));
draw((6,0)--(6,1));
draw((6,2)--(7,2)--(7,-4)--(6,-4)--cycle);
draw((6,-1)--(7,-1));
draw((6,-2)--(7,-2));
draw((6,-3)--(7,-3));
draw((3,0)--(4,0)--(4,-3)--(3,-3)--cycle);
draw((3,-1)--(4,-1));
draw((3,-2)--(4,-2));
label("21",(0.5,0.8),S);
label("14",(3.5,-1.2),S);
label("18",(3.5,-2.2),S);
label("$N$",(6.5,1.8),S);
label("-17",(6.5,-3.2),S);
[/asy] ### Response: Let $x$ be the difference between consecutive terms in the arithmetic sequence in the row of squares, $y$ be the difference between consecutive terms in the arithmetic sequence in the first column of squares, and $z$ be the difference between consecutive terms in the arithmetic sequence in the second column of squares. From the diagram, we can construct three equations:  \begin{align*}
21+5x&=N \\
14+2y&=N \\
18+3z&=N
\end{align*} We can solve for $N$ by setting the three expressions equal to each other: \begin{align*}
21+5x&=14+2y \\
14+2y&=18+3z \\
21+5x&=18+3z
\end{align*} Solving the first two equations yields $\begin{array}{l l}y=3x,&(1) \\ z=4y,&(2)\end{array}$ but substitution gives $z=4(3x)=12x$. The third equation yields $21+5x=18+3(12x)$. Simplifying yields $-33x=-9$, so $x=\frac{3}{11}$. Since $y=3x$, $y=\frac{3}{11}\cdot3=\frac{9}{11}$. Substituting into the first equation gives $21+5\left(\frac{3}{11}\right)=N+\frac{9}{11}$, so $N=21+\frac{15}{11}-\frac{9}{11}=\frac{216}{11}$. Thus, $N=\boxed{216}$.

