Below is an instruction that describes a task. Write a response that appropriately completes the request. ### Instruction: For all complex numbers $z$, let \[f(z) = \left\{
\begin{array}{cl}
z^{2}&\text{ if }z\text{ is not real}, \\
-z^2 &\text{ if }z\text{ is real}.
\end{array}
\right.\]Find $f(f(f(f(1+i))))$. ### Response: First, we find $f(1+i)$. Since $1+i$ is not real, $f(1+i) = (1+i)^2 = 1 + 2i - 1 = \boxed{2i}$. Now, we find $f(f(f(f(1+i)))) = f(f(f(2i)))$. Since $2i$ is not real, $f(f(f(2i))) = f(f(-(2i)^2)) = f(f(-4))$. Now, $-4$ is real, so $f(f(-4)) = f(-4)^2$. Since $-4$ is real, $f(-4) = -(-4)^2 = -16$. Finally, $f(f(-4)) = f(-16)^2 = (-16)^2 = \boxed{256}$.

Below is an instruction that describes a task. Write a response that appropriately completes the request. ### Instruction: If $f(x) = x^4 + x^2 + 5x$, evaluate $f(5) - f(-5)$. ### Response: We have  \begin{align*}
f(5) - f(-5) &= \left[ (5)^4 + (5)^2 + 5(5) \right] - \left[ (-5)^4 + (-5)^2 + 5(-5) \right] \\
&= \left[ 625 + 25 + 25 \right] - \left[ 625 + 25 - 25 \right] \\
&= \boxed{100}.
\end{align*}

