Label f;

f.p=fontsize(4);

xaxis(-3,3,Ticks(f, 1.0));

yaxis(-4,4,Ticks(f, 1.0));

real f(real x)

{

return x^2+2x-1;

}

draw(graph(f,-2.7,.7),linewidth(1),Arrows(6));
[/asy] ### Response: From the graph, we observe that the vertex of the parabola is at the point $(-1,-2)$. Since the equation of a parabola in vertex form is $y=a(x-h)^2+k$, where $(h,k)$ is the vertex, we can write the equation of the parabola as $y=a(x+1)^2-2$. Expanding $(x+1)^2$ gives $y=a(x^2+2x+1)-2$. Distributing the $a$ gives $y=ax^2+2ax+a-2$. Comparing this with the equation $y=ax^2+bx+c$, we see that $b=2a$ and $a-2=c$. From $b=2a$, we find that $a=\frac{b}{2}$. Substituting this into the equation $a-2=c$, we find that $\frac{b}{2}-2=c$, or $\frac{b-4}{2}=c$. Thus, $a-b+c=\frac{b}{2}-b+\frac{b-4}{2}=-\frac{b}{2}-2=-\frac{b+4}{2}=-b-2$. Since $b$ is an integer, the value of $a-b+c$ is always an integer, so our answer is $\boxed{-2}$.

