\end{align*}Alternatively, we could note that the given expression is a sum of cubes and apply the formula $a^3+b^3=(a+b)(a^2-ab+b^2)$. In this case, $a=5z^{17}$ and $b=11z^{17}$, so the factored form is \begin{align*}
55z^{17}+121z^{34} &= (5z^{17})^3+(11z^{17})^3 \\
&= (5z^{17}+11z^{17})((5z^{17})^2-(5z^{17})(11z^{17})+(11z^{17})^2) \\
&= \boxed{11z^{17}(5+11z^{17})}.
\end{align*}

