Below is an instruction that describes a task. Write a response that appropriately completes the request. ### Instruction: Wanda is trying to locate the Fermat point $P$ of $\triangle ABC$, where $A$ is at the origin, $B$ is at $(8,-1)$, and $C$ is at $(5,4)$ (the Fermat point is the point such that the sum of its distances from the vertices of a triangle is minimized). She guesses that the point is at $P = (4,2)$, and computes the sum of the distances from $P$ to the vertices of $\triangle ABC$. If she obtains $m + n\sqrt{5}$, where $m$ and $n$ are integers, what is $m + n$?

[asy]
string sp(pair P1, string P2){return "$" + P2 + "\,(" + string(P1.x) + "," + string(P1.y) + ")$";}
size(150); defaultpen(fontsize(10)); draw((-3,0)--(10,0),Arrows(4)); draw((0,-3)--(0,8),Arrows(4)); pair A=(0,0),B=(8,-1),C=(5,4),P=(4,2); draw(A--B--C--cycle, linewidth(0.7)); draw(A--P, dashed); draw(B--P, dashed); draw(C--P, dashed); label(sp(A,"A"),A,NW); label(sp(B,"B"),B,S); label(sp(C,"C"),C,N); label(sp(P,"P"),P,(-0.5,-2.8)); dot(A); dot(B); dot(C); dot(P);
[/asy] ### Response: We compute $AP=\sqrt{4^2+2^2}=2\sqrt{5}$. For $BP$, observe that $\angle APB$ must equal $120^\circ$ because the $60^\circ$ rotation centered at $A$ sends $C$ to $B$. Then by the Law of Cosines on triangle $APB$, we get $PB=\sqrt{10^2+2^2-2(10)(2)\cos 120^\circ}=2\sqrt{5}$. Similarly, $CP=2\sqrt{5}$.

Finally, we obtain $AP+BP+CP=2(2\sqrt{5})=4\sqrt{5}$ for an answer of $4+5=\boxed{009}$.

