text:
Below is an instruction that describes a task. Write a response that appropriately completes the request. ### Instruction: Piravena must make a trip from $A$ to $B,$ then from $B$ to $C,$ then from $C$ to $A.$ Each of these three parts of the trip is made entirely by bus or entirely by airplane. The cities form a right-angled triangle as shown, with $C$ a distance of $3000\text{ km}$ from $A$ and with $B$ a distance of $3250\text{ km}$ from $A.$ To take a bus, it costs Piravena $\$0.15$ per kilometer. To take an airplane, it costs her a $\$100$ booking fee, plus $\$0.10$ per kilometer. [asy]
pair A, B, C;
C=(0,0);
B=(0,1250);
A=(3000,0);
draw(A--B--C--A);
label("A", A, SE);
label("B", B, NW);
label("C", C, SW);
label("3000 km", (A+C)/2, S);
label("3250 km", (A+B)/2, NE);
draw((0,125)--(125,125)--(125,0));
[/asy]  To begin her trip she flew from $A$ to $B.$ Determine the cost to fly from $A$ to $B.$ ### Response: The distance between $A$ and $B$ is $\sqrt{3250^2-3000^2}=700$ km. Therefore, the cost to fly from $A$ to $B$ is $100+0.10(700)=\boxed{170}$. Alternatively, we could observe that the airplane fare is $\$0.10$ per km, so the cost is $0.10(3250)=\$325$, but since Piravena is partway through the trip, she has already paid $0.10(3000)=\$300$, so she still owes $\$325-\$300=\$25$ in airplane tickets. However, since the cost to go by bus would be $\$0.15(3250)=\$487.50$, she chooses to fly, and the cost is only $\$100+\$25=\boxed{\$125}$.

