\text{Mon} & \implies (8-t)t. \\
\text{Tues} & \implies (2-t)(t+3).
\end{align*}Expanding the Tues expression and adding $-t^2-6t+6t+18$, we get \begin{align*}
\text{Tues } = 6 &= 8t+6 \\
6 &= 8t \\
\frac{3}{4} &= t. \\
\end{align*}
